import React from 'react'
import styled from 'styled-components';

const Anchor = styled.a`
  color: #FFC759;
  font-size: 12px;
  letter-spacing: 1px;
  font-weight: 500;
  &:hover {
      text-decoration: none;
      color: #FFC759;
  }
`

function Link(props) {
  return (
    <a href={props.a}
      alt={props.alt}
      value={props.value}
    />
  );
}

export default Link
